import React, {Component} from "react"

class Grid extends Component{

    render(){

        var arr=[];
        var size=20;

        function newBlock(){
            return <div className="block"></div>
        }
        // arr=newBlock();

        var arr = new Array(size);

        for(var i=0;i<size;i++){
            arr[i]=new Array(size);
        }

        for (var i=0;i<size;i++){
            for (var j=0;j<size;j++){
                arr[i][j]=newBlock();
            }
        }

        return(
            <div>
                {arr.map((row,rowId) => {
                    return (
                        <div key={rowId}>
                            {row.map((node,nodeId) => {
                                return (
                                    newBlock()
                                )
                            })}
                        </div>
                    )
                })}
            </div>
        );
    }
}

export default Grid;
